import { LinearProgress as LinearProgressBase, } from './LinearProgress';
const LinearProgress = Object.assign(LinearProgressBase, {
    INDETERMINATE: 'indeterminate',
    DETERMINATE: 'determinate',
});
export { LinearProgress };
